    /* BG SLIDESHOW CSS */
    .slideshow,
    .slideshow::after {
      position: fixed;
      width: 100%;
      height: 100%;
      top: 0px;
      left: 0px;
      z-index: 0px;
    }

    .slideshow::after {
      content: '';
      background: linear-gradient(-70deg, rgba(0, 0, 0, 0), rgba(0, 0, 0, 1));
    }

    .img-bg-slide {
      width: 100%;
      height: 100%;
      position: absolute;
      top: 0px;
      left: 0px;
      color: transparent;
      /*hides span's text*/
      background-size: cover;
      /* covers whole viewport */
      background-position: 100% 100%;
      background-repeat: none;
      opacity: 0;
      z-index: 0;
      animation: backgroundSlideshow 60s linear infinite 0s;
    }

    .slideshow li:nth-child(1) .img-bg-slide {
      background-image: url('data:image/jpeg;base64,');
    }


    .slideshow li:nth-child(2) .img-bg-slide {
      background-image: url('data:image/jpeg;base64,');

      animation-delay: 15s;
    }

    
  
    .slideshow li:nth-child(3) .img-bg-slide {
      background-image:url('data:image/jpeg;base64,');
      animation-delay: 30s;
